// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { useState, useEffect } from "react";

// Component
// import Home from "./components/home/Home";

// =================================================================
const useStyles = createUseStyles({
  SignIn :{
    minHeight: "100vh",
  },
  signin__title :{
    fontSize: "5rem",
  },
  signin__separate :{
    marginBottom: "2rem",
    fontSize: "1.5rem",
    color: "var(--text-color)",
  },
  signin__link :{
    display: "flex",
    gap: "5rem",
    marginTop: "2rem",
    color: "var(--text-color)",
    fontSize: "1.6rem",
  },
  "signin__link--light ":{
    color: "var(--text-color-light) !important",
  },
  

});

export default function SignIn() {
  const classes = useStyles();

  return (
    <div className="SignIn">
      <div className="content">
        <h1 className="signin__title">Sign In.</h1>

        <div className="buttons">
        
        </div>

        <div className="signin__separate">or</div>

        <div className="inputs">
        <input
          type="email"
          placeholder="Email"
          className="signin__input input--border btn--full-width"
        />
        <input
          type="password"
          placeholder="Password"
          className="signin__input input--border btn--full-width"
        />
        </div>

        <button className="button btn--bg-pink btn--bb-pink btn--none-border btn--full-width btn--flex">
          <span className="button__text">Sign Up</span>
        </button>

        <div className="signin__link">
          <span>Don't have an account?</span>
          <a href="sdd">Sign up</a>
        </div>

        <a href="#" className="signin__link signin__link--light">
          Forgot password?
        </a>

        <a href="#" className="signin__link">
          <ion-icon name="arrow-back-outline"></ion-icon>
          <div>Back to Home</div>
        </a>
      </div>
    </div>
  );
}
